  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains sensitive biological
  resource data for wading birds, shorebirds, waterfowl, diving birds, seabirds, raptors,
  gulls, and terns in Puget Sound and Strait of Juan de Fuca, Washington. Vector polygons
  in this data set represent locations of bird resting, feeding, migratory staging,
  and wintering sites. Species-specific abundance, seasonality, status, life history,
  and source information are stored in relational data tables (described below) designed
  to be used in conjunction with this spatial data layer.This data set comprises a
  portion of the Environmental Sensitivity Index (ESI) data for Puget Sound and Strait
  of Juan de Fuca, Washington. ESI data characterize the marine and coastal environments
  and wildlife by their sensitivity to spilled oil. The ESI data include information
  for three main components: shoreline habitats, sensitive biological resources, and
  human-use resources. See also the NESTS (Nest Points) data layer, part of the larger
  Puget Sound and Strait of Juan de Fuca ESI database, for additional bird information.\",\n\t\"license_title\":
